#include <misc.h>
#include <params.h>

module cloudbrain_convo_module
use shr_kind_mod,    only: r8 => shr_kind_r8
use ppgrid,          only: pcols, pver, pverp
use history,         only: outfld, addfld, add_default, phys_decomp
use physconst,       only: gravit,cpair
implicit none

save

private                         ! Make default type private to the module
integer,parameter :: nbneurons = 32
integer, parameter ::nbhiddenlayers = 6
integer,parameter :: nlev = 21 ! Only the bottom this-many levels are used in the neural net.
integer,parameter :: nchannel_in = 7 ! Input variables 

integer,parameter :: nchannel_out = 2 ! Output variables 

public cloudbrain

contains 

subroutine cloudbrain_convo(TAP, QAP, OMEGA, SHFLX, LHFLX, dTdt_adiabatic, dQdt_adiabatic, SPDT, SPDQ)

real(r8), intent(in) :: TAP(pver)
real(r8), intent(in) :: QAP(pver)
real(r8), intent(in) :: OMEGA(pver)
real(r8), intent(in) :: SHFLX
real(r8), intent(in) :: LHFLX
real(r8), intent(in) :: dTdt_adiabatic(pver)
real(r8), intent(in) :: dQdt_adiabatic(pver)
real(r8), intent(out) :: SPDT(pver) ! W/kg
real(r8), intent(out) :: SPDQ(pver) ! W/kg
real(r8) :: input(nlev,nchannel_in)
real(r8) :: input_padded(nlev+2,nchannel_in)
real(r8) :: interior_input_padded(nlev+2,nbneurons)
real(r8) :: new_state (nlev,nbneurons)
real(r8) :: conv2d_input_kernel(3,nchannel_in,nlev)
real(r8) :: conv2d_input_bias(nbneurons)
real(r8) :: conv2d_current_interior_kernel(3,nbneurons,nlev)
real(r8) :: conv2d_current_interior_bias(nbneurons)
real(r8) :: conv2d_outer_kernel (nbneurons,nchannel_out)
real(r8) :: conv2d_outer_bias (nchannel_out)
real(r8) :: out_state (nlev,nchannel_out)
real(r8) :: meanvect(nlev),stdvect(nlev) ! tmp buffers for var-specific normalization vectors. 
integer :: ilayer,k,kchan,jnewchan,kfilt 

! ------- neural net input matrix & normalization ----
meanvect(:)= (/ 197.625888,205.112067,213.283672,221.940882,230.859788,239.837809,248.640464,256.902046,264.559980,271.741487,278.195212,283.576083,287.498407,289.803554,291.545346,292.847813,294.189118,295.585967,297.064959,298.488387,299.822008 /) 
stdvect(:)= (/ 197.625888,205.112067,213.283672,221.940882,230.859788,239.837809,248.640464,256.902046,264.559980,271.741487,278.195212,283.576083,287.498407,289.803554,291.545346,292.847813,294.189118,295.585967,297.064959,298.488387,299.822008,0.927353 /) 
input(:,1)= (TAP((pver-nlev+1):pver) - meanvect)/stdvect 
meanvect(:)= (/ 0.000003,0.000008,0.000025,0.000064,0.000142,0.000294,0.000562,0.001023,0.001817,0.003014,0.004578,0.006547,0.009005,0.011688,0.013407,0.014597,0.015788,0.016879,0.017548,0.017920,0.018107 /) 
stdvect(:)= (/ 0.000003,0.000008,0.000025,0.000064,0.000142,0.000294,0.000562,0.001023,0.001817,0.003014,0.004578,0.006547,0.009005,0.011688,0.013407,0.014597,0.015788,0.016879,0.017548,0.017920,0.018107,0.001530 /) 
input(:,2)= (QAP((pver-nlev+1):pver) - meanvect)/stdvect 
meanvect(:)= (/ -0.001635,-0.003726,-0.007228,-0.011364,-0.014606,-0.016101,-0.016173,-0.016007,-0.016274,-0.016894,-0.017477,-0.017717,-0.017755,-0.017615,-0.017366,-0.016995,-0.015875,-0.013175,-0.009431,-0.005737,-0.002484 /) 
stdvect(:)= (/ -0.001635,-0.003726,-0.007228,-0.011364,-0.014606,-0.016101,-0.016173,-0.016007,-0.016274,-0.016894,-0.017477,-0.017717,-0.017755,-0.017615,-0.017366,-0.016995,-0.015875,-0.013175,-0.009431,-0.005737,-0.002484,0.013350 /) 
input(:,3)= (OMEGA((pver-nlev+1):pver) - meanvect)/stdvect 
input(:,kchannelin) = (QAP-7.475819)/5.462161
input(:,kchannelin) = (QAP-127.839097)/55.449506
meanvect(:)= (/ -0.000003,-0.000001,0.000000,0.000000,-0.000003,-0.000008,-0.000011,-0.000011,-0.000011,-0.000011,-0.000010,-0.000009,-0.000008,-0.000002,-0.000007,-0.000010,-0.000012,-0.000012,-0.000010,-0.000006,-0.000006 /) 
stdvect(:)= (/ -0.000003,-0.000001,0.000000,0.000000,-0.000003,-0.000008,-0.000011,-0.000011,-0.000011,-0.000011,-0.000010,-0.000009,-0.000008,-0.000002,-0.000007,-0.000010,-0.000012,-0.000012,-0.000010,-0.000006,-0.000006,0.000023 /) 
input(:,6)= (dTdt_adiabatic((pver-nlev+1):pver) - meanvect)/stdvect 
meanvect(:)= (/ 0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000 /) 
stdvect(:)= (/ 0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000,-0.000000,0.000000 /) 
input(:,7)= (dQdt_adiabatic((pver-nlev+1):pver) - meanvect)/stdvect 
! ------- input layer, define underlying matrices: ----
call get_inputlayer_data (conv2d_input_bias,conv2d_input_kernel)

! ------- input layer, pad and do the magic:
input_padded(1,:) = input(1,:)
input_padded((nlev+2),:) = input(nlev,:)
! ---- Go from 23x7 padded input to 21x32 for first dense layer
new_state(:,:) = 0.
do jnewchan = 1,nbneurons then
  do kchan = 1,nchannel_in then
    do k = 2,nlev+1 then
      do kfilt = 1,3 then
        new_state(k-1,jnewchan) = new_state(k-1,jnewchan) + input_padded(k+kfilt-2,kchan)*conv2d_input_kernel(kfilt,kchan,jnewchan)
      end do
    end do
  end do
! --- Apply bias and then leaky relu activation function:
  do k=1,nlev then
    new_state(k,jnewchan) = new_state(k,jnewchan) + conv2d_input_bias(jnewchan)
    if (new_state(k,jnewchan) .lt. 0.) then
      new_state(k,jnewchan) = new_state(k,jnewchan)*0.3
    end if
  end do
end do
! ---- NOW do the same as above but for an outer loop over all the hidden layers:
! ---- in each step, we go from a 21x32 --> 23x32 padded --> (net matrices) --> the next 21x32 --> its bias, activation :
do ilayer = 1,nbhiddenlayers-1 then
  call get_hiddenlayer_data (ilayer,conv2d_current_interior_bias,conv2d_current_interior_kernel)
  interior_input_padded(2:nlev+1,:) = new_state(:,:)
  interior_input_padded(1,:) = new_state(1,:)
  interior_input_padded(nlev+2,:) = input(nlev,:)
! ---- Go from 23x32 padded input to current dense layer to 21x32 for new_state that will arrive at next dense layer
  new_state(:,:) = 0. ! nlev x nbneurons 
  do jnewchan = 1,nbneurons then
    do kchan = 1,nbneurons then
      do k = 2,nlev+1 then
        do kfilt = 1,3 then
          new_state(k-1,jnewchan) = new_state(k-1,jnewchan) + interior_input_padded(k+kfilt-2,kchan)*conv2d_current_interior_kernel(kfilt,kchan,jnewchan)
        end do
      end do
    end do !kchan
! --- Apply bias and then leaky relu activation function:
    do k=1,nlev then
      new_state(k,jnewchan) = new_state(k,jnewchan) + conv2d_current_interior_bias(jnewchan)
      if (new_state(k,jnewchan) .lt. 0.) then
        new_state(k,jnewchan) = new_state(k,jnewchan)*0.3
      end if
    end do
  end do !jnewchan 
end do !ilayer 


! ---- Finally, for the outer layer, we go from 21x32 --> (no padding) --> (net matrices) --> the outer (2x21) --> its bias, NO activation :
call subroutine get_outerlayer_data (conv2d_outer_bias,conv2d_outer_kernel)
out_state(:,:) = 0. ! nlev x nchannel_out 
do jnewchan = 1,nchannel_out then
  do kchan = 1,nbneurons then
    do k=1,nlev then
      out_state(k,jnewchan) = out_state(k,jnewchan) + new_state(k,kchan)*conv2d_outer_kernel(kchan,jnewchan)
    end do
  end do !kchan
! --- Apply bias but NO activation function:
  do k=1,nlev then
    out_state(k,jnewchan) = out_state(k,jnewchan) + conv2d_outer_bias(jnewchan)
  end do
end do ! jnewchan


! links to subroutine outputs: 
SPDT(:) = 0.
SPDT((pver-nlev+1):pver) = out_state(:,1)
SPDQ(:) = 0.
SPDQ((pver-nlev+1):pver) = out_state(:,2)
end subroutine cloudbrain_convo


