subroutine get_hiddenlayer_data (ihiddenlayer,conv2d_current_interior_bias,conv2d_current_interior_kernel)
integer, intent(in) :: ihiddenlayer 
real(r8), intent(out) :: conv2d_current_interior_bias(nbneurons)
real(r8), intent(out) :: conv2d_current_interior_kernel(3,nbneurons,nlev)
